import React from 'react'
import { motion } from 'framer-motion'

const ImageCard = (props) => {
    const imageThumb = () => {
        let thumbUrl = "https://i.imgur.com/1sYu3VL.png"
        if (props.image.thumb_url) {
            thumbUrl = props.image.thumb_url
        }

        return thumbUrl
    }

    return (
        <motion.div
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.9 }}
          className="uk-card uk-card-default uk-height-small uk-flex uk-flex-center uk-flex-middle uk-light"
          alt={props.image.title}
          data-uk-img
        >
            <h1>{props.image.title}</h1>
        </motion.div>
    );
}

export default ImageCard;
